.header-1 {
    height: 122px;
    display: flex;
    flex-direction: row;
    justify-content: space-evenly;
    border-bottom: 1px solid;
    border-bottom-color: whitesmoke;
}



@media only screen and (min-width: 1270px) {
.title-logo-2 img {
    padding-top: 19px;
    /* padding-right: 270px; */
    width: 729;
    height: 90;
}
.title-logo  {
    /* padding-top: 30px; */
    /* margin-right: 310px; */
    width: 5px;
    height: 4px;
}

}

@media only screen and (max-width: 1270px) {
    .title-logo-2 img {
        width: 0;
        height: 0;
    }
    .title-logo img {
        padding-top: 25px;
        margin: 0 auto;
    }
}


.header-2 {
height: 65px;
display: flex;
flex-direction: row;
justify-content: space-evenly;
} 

.content-header2 {
    height: 100%;
    width: 50%;
    /* margin-left: 320px; */
    margin-top: 20px;
}

.item-header2 {
    margin-left: 20px;
    font-family: nunito sans,sans-serif;
    font-size: 15px;
    color: #939393;
}
.image-header-1 {
    background-color: #0e0e11;
    height: 440px;
}

.luar-sini {
    height: 100%;
}
.image-header-2 {
    height: 100%;
}
.image-header-2 img {
    opacity: 0.6;
    height: 100%;
}

.image-header-3 {
    height: 100%;
}
.image-header-3 img {
    opacity: 0.6;
    height: 50%;
}
